webpackJsonp([0x68750dd819eb],{482:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Пятиминутка React",author:"Пятиминутка React"}},markdownRemark:{id:"/Users/petr/www/5minreact.ru/src/pages/47-elm-019/index.md absPath of file >>> MarkdownRemark",html:'<iframe width="100%" height="166" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/497163783%3Fsecret_token%3Ds-YVNxe&color=%23ff5500&auto_play=false&hide_related=true&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>\n<p>Обсудили вместе с Алексеем Пироговым (<a href="https://twitter.com/alex_pir">https://twitter.com/alex_pir</a>) новую версию, тенденции в развитии языка, его недостатки и нишу в веб-разработке, бегло сравнили с другими ФП языками в вебе. Отдельно поговорили про Reason, Go, ООП, Go2 и generics, вероятность появления Elm2.</p>\n<ul>\n<li><a href="https://elm-lang.org/">https://elm-lang.org/</a></li>\n<li><a href="https://t.me/brain_dump_etc">https://t.me/brain<em>dump</em>etc</a> - Telegram канал Алексея</li>\n<li><a href="https://devzen.ru/episode-0194/">https://devzen.ru/episode-0194/</a> - Алексей в подкасте DevZen</li>\n</ul>',frontmatter:{title:"#47 - Elm 0.19",date:"September 13, 2018",featuredImage:null}}},pathContext:{slug:"/47-elm-019/",previous:{fields:{slug:"/46-juliarderity-by-chicoxyzzy/"},html:'<iframe width="100%" height="166" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/495406275%3Fsecret_token%3Ds-ax86W&color=%23ff5500&auto_play=false&hide_related=true&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>\n<p>Сергей Рубанов, известный в широких фронтенд кругах Панк-разработчик из города Орла, член команды Babel и участник WebAssembly Community Group в начале августа запустил телеграм канал Хулиардерити.</p>\n<p>Пишет в осоновном хардкорные новости из недр комитета TC39, из кишков Babel и всего такого, что в обычных пабликах и хабрах не публикуют, т.к. слишком гиково. А нам такое как раз интересно!</p>\n<ul>\n<li><a href="https://t.me/juliarderity">https://t.me/juliarderity</a></li>\n<li><a href="https://twitter.com/chicoxyzzy">https://twitter.com/chicoxyzzy</a></li>\n</ul>',excerpt:"Сергей Рубанов, известный в широких фронтенд кругах Панк-разработчик из города Орла, член команды Babel и участник WebAssembly Community…",frontmatter:{title:"#46 - Juliarderity by Chicoxyzzy - хардкорные новости о JavaScript в Telegram",date:"September 6, 2018",featuredImage:null}},next:null}}}});
